[Form]
public class InventTransferJour extends FormRun
{
    InventDimCtrl_Frm   inventDimFormSetup;

    // <GIN>
    QueryBuildRange         qbrInventSiteGateEntryLine;
    Map                     mapIsExciseEnable_IN;
    boolean                 isExciseParameterEnabled_IN;
    boolean                 isINCountryRegion;
    // </GIN>

    #ISOCountryRegionCodes

}

public void init()
{
    // <GIN>
    mapIsExciseEnable_IN = new Map(typeName2Type(extendedTypeStr(InventTransferId)), Types::Enum);
    isExciseParameterEnabled_IN = TaxParameters::isExciseEnable_IN();
    isINCountryRegion = SysCountryRegionCode::isLegalEntityInCountryRegion([#isoIN]);
    // </GIN>

    super();
    element.updateDesign(InventDimFormDesignUpdate::Init);
    TransferOrderCancel.visible(!SysCountryRegionCode::isLegalEntityInCountryRegion([#isoRU]));
    InventTransferJour_CanceledShipment.visible(!SysCountryRegionCode::isLegalEntityInCountryRegion([#isoRU]));

    // <GTE>
    if (TaxSolutionScopeIntegrationUtil::isCompanyEnabled())
    {
        TaxDocument.visible(true);
        // <GIN>
        if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoIN]))
        {
            GSTSTOInvoice.visible(true);
        }
        // </GIN>
    }
    // </GTE>
}

void updateDesign(InventDimFormDesignUpdate mode)
{
    InventDimParm   inventDimParmShow;

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init        :
            if (! inventDimFormSetup)
                inventDimFormSetup  = InventDimCtrl::newFromForm(element);
            inventDimParmShow.initFromInventDimSetupGrid(fieldNum(InventDimSetupGrid,ShowGridTransferOrder));
            inventDimFormSetup.parmDimParmVisibleGrid(inventDimParmShow);
        // No break
        case InventDimFormDesignUpdate::Active:
            inventDimFormSetup.formSetControls(true);
            break;

        default : throw error(strFmt("@SYS54195",funcName()));
    }

    // <GIN>
    GateEntryDetails_IN.visible(isINCountryRegion);
    // </GIN>
}

/// <summary>
/// Sets the field visibility if transfer order type is stock transfer
/// </summary>
/// <returns>
/// Returns true if it is stock transfer
/// </returns>
public int active()
{
    //<GIN>
    int                     ret;
    InventTransferTable     inventTransferTable;
    InventTransferId        transferId;

    ret = super();
    inventTransferTable = InventTransferJour.inventTransferTable();
    transferId = InventTransferJour.TransferId;

    if (inventTransferTable.TransferType_IN == TransferType_IN::StockTransfer)
    {
        InventTransferJourLine_IN_AssessableValue.visible(true);
        if (isExciseParameterEnabled_IN)
        {
            ExciseTransferInvoice.visible(true);
        }
    }
    //</GIN>

    // <GTE>
    if (inventTransferJour.UpdateType == InventTransferUpdateType::Shipment
        && TaxGSTInvoiceHelper_IN::isGSTInvoice(InventTransferJour))
    {
        GSTSTOInvoice.enabled(true);
    }
    else
    {
        GSTSTOInvoice.enabled(false);
    }
    // </GTE>

    buttonPrintReceipt.visible(InventTransferJour.UpdateType == InventTransferUpdateType::Receive);
    buttonPrintShip.visible(InventTransferJour.UpdateType == InventTransferUpdateType::Shipment);

    if (!InventTransferTable::hasReceivedJournal(InventTransferJour.TransferId)
        && !InventTransferJour.isCanceled()
        && InventTransferJour.CanceledShipment == NoYes::No)
    {
        // Enable transfer order shipment cancellation only when there is no related WHSLoadLine.
        InventTransferJourLine transferJourLine;
        WHSWorkLine whsWorkLine;
        WHSLoadLine whsLoadLine;
        boolean hasWHSLoadLine;

        select firstonly RecId from transferJourLine
            where transferJourLine.TransferId == transferId
            && transferJourLine.VoucherId == InventTransferJour.VoucherId
        exists join whsWorkLine
            where whsWorkLine.InventTransId == transferJourLine.InventTransId;

        if (!transferJourLine.RecId)
        {
            select firstonly RecId from transferJourLine
                where transferJourLine.TransferId == transferId
                && transferJourLine.VoucherId == InventTransferJour.VoucherId
            exists join whsLoadLine
                where whsLoadLine.InventTransId == transferJourLine.InventTransId;
        }

        TransferOrderCancel.enabled(!transferJourLine.RecId);
    }
    else
    {
        TransferOrderCancel.enabled(false);
    }

    InventTransferJour_CanceledShipment.visible(true);

    if (TransferOrderCancel.isEnabled()
        && inventTransferTable.TransferStatus != InventTransferStatus::Received
        && InventTransferOrderRegisterItemDisableCancelFlight::instance().isEnabled())
    {
        TransferOrderCancel.enabled(InventTransferLine::shippedTransferOrderNotExistPickedTransaction(transferId));
    }

    return ret;
}

public void init()
{
    if (BrazilParameters::isEnabled())
    {
        this.linkType(FormLinkType::OuterJoin);
    }
    super();
}

public int active()
{
    int ret;

    ret = super();

    if (isINCountryRegion)
    {
        InventSiteGateEntryLineView_IN_Ds.linkActive();
    }

    return ret;
}

public void init()
{
    if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoIN]))
    {
        this.linkType(FormLinkType::OuterJoin);
    }
    super();
}

/// <summary>
/// Perform validations on initialize of current datasource.
/// </summary>
public void init()
{
    super();

    if (isINCountryRegion)
    {
        qbrInventSiteGateEntryLine = this.query().dataSourceTable(tableNum(InventSiteGateEntryLineView_IN)).addRange(fieldNum(InventSiteGateEntryLineView_IN, InventSiteGateEntryLine));
    }
}

/// <summary>
/// Perform validations on execute query of current datasource.
/// </summary>
public void executeQuery()
{
    if (isINCountryRegion)
    {
        qbrInventSiteGateEntryLine.value(SysQuery::value(InventTransferJourLine_IN.InventSiteGateEntryLine));
    }

    super();
}
